full_text:
Fantastic, scathing piece on the hospital readmissions reduction program by @StephenSoumerai.

@statnews #hospitals #readmissions #HRRP

https://t.co/z5Eyzwp51G

Evaluation of the Hospital Readmissions Reduction Program raises concerns surrounding ability of program incentives to reduce avoidable readmissions without concurrent reduction in necessary readmissions. 
https://t.co/HIWCpPJ7FF
@ResnickMJ @JUrology

Evaluation of the Hospital Readmissions Reduction Program raises concerns surrounding ability of program incentives to reduce avoidable readmissions without concurrent reduction in necessary readmissions. 
https://t.co/gQyOV2s9oE
@ResnickMJ @JUrology

@ColtonOrtolf you are welcome - one more:

'MedPAC‚Äôs Proposed ‚ÄúReforms‚Äù Should Be Tested Before They‚Äôre Implemented: CMS‚Äôs Hospital Readmissions Reduction Program Is Exhibit A'

https://t.co/ZVyqTlx4Ye

Association of the Hospital Readmissions Reduction Program w/ Mortality Among Medicare Beneficiaries Hospitalized for Heart Failure, Acute Myocardial Infarction &amp; Pneumonia
@rkwadhera @BrighamWomens @harvardmed @BIDMChealth https://t.co/29dK1XY2Oh 
@JAMANetwork

