full_text:
We found that implementation of the Hospital Readmissions Reduction Program was followed by a rise in mortality among heart failure and pneumonia patients.  

https://t.co/Pel0jjJOJy

@SmithBIDMC's latest in @JAMA_current today led by @rkwadhera with @kejoynt and @Changyushen312. https://t.co/KqmcOZJheR

